const Product = (props) => {
    const {
        name,
        image,
        price,
        description,
        created_date,
        updated_date
    } = props

  return (
    <div className='product'>
         <img  
            alt="elf_img" 
            src={require({image})}
        />


        <span>{name}</span>
        
    </div>
  )
}

export default Product
